import styles from "./MealItemForm.module.css";
import Input from "../UI/input/Input.js";
let MealItemForm = () => {
  return (
    <form className={styles.form}>
      <Input
        input={{
          htmlFor: "Amount",
          id: "amount",
          type: "number",
          min: "1",
          max: "5",
          
        }}
      />
      <button>+ Add</button>
    </form>
  );
};
export default MealItemForm;
